generated.css:
.gg-header {
    background-color: rgba(10, 17, 36, 1);
    box-shadow: 0 0 5px rgba(0, 0, 0, 0.7);
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
}

.gg-header > * {
    color: white;
}

.gg-header-container {
    display: flex;
    flex-direction: row;
    align-items: center;
    max-width: var(--content-width);
    width: 100%;
}

.gg-header-container__buttons {
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
}

.gg-header-container__buttons button {
    width: 113px;
    max-width: 113px;
    max-height: 28px;
}

.gg-header-container__buttons button:first-child {
    margin-right: 16px;
}
